import Axios from 'axios'

const URL_API = 'http://localhost:8888/'

export const onLoginUser = (EMAIL, PASSWORD) => {
    return(dispatch) => {
        Axios.get(
            URL_API + 'auth/register',
            {
                params: {
                    email: EMAIL,
                    password: PASSWORD
                }
            }
        )
    }
}
